// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
contract Leilao { 
    event Start(uint startingBid);
    event End(address winner, uint highestBid);
    event Bid(address indexed sender, uint amount);
    bool public started = false;
    bool public ended;
    uint public endAt;
    uint TokenID =0;
    uint public highestBid ;
    address public highestBidder  ;
    address  sponser ;
    mapping (address => uint) lances;
    lance[]  _lances;
    struct lance {
        uint valor;
        address dono;
        
    } 
    constructor() {
    }
/*
    modifier OnlyMinter() {
        require(Token.isMintedr(), "Voce nao tem privilegios para executar essa acao");
        _;
    }
    function isMintedr() public view returns(bool) {
        return Token.isMintedr();
    }
    */
    function addMinter(address minter) public {
        //Token.setI( minter);
    }
  
    function bid() external payable {
        require(started, "O Leilao ainda nao comecou");
        require(ended == false, "O Leilao ja terminou");
        require(msg.value > highestBid, "O valor tem que ser maior que o lance mais alto");
         lance memory _lance;
        _lance.dono = msg.sender;
        _lance.valor =   msg.value;
        _lances.push(_lance);

        highestBidder = msg.sender;
        lances[msg.sender] = msg.value;
        highestBid = msg.value;
        emit Bid(msg.sender,msg.value);
        
    }
    function widthdraw() external payable {
        require(ended ,"O leilao ainda nao terminou");
        require(msg.sender != highestBidder, "O ganhador nao pode sacar");
        uint bal = lances[msg.sender];
        require(bal > 0, "Voce nao tem nada pra sacar");
        lances[msg.sender] = 0;
        payable(msg.sender).transfer(bal);
    }

    function start(uint startingBid) public {
        //require(started == false,"Leilao ja iniciado");
        started = true;
        ended = false;
        endAt = block.timestamp + 10 minutes;
        //Token.mintNFT(sponser, nftUrl);
        //TokenID = Token.getToken(sponser);
        highestBid = startingBid;
        

        emit Start(startingBid);
    }

     function end()  external  {
        require(started,"Leilao nao iniciado");
        require(block.timestamp > endAt,"Leilao ainda nao terminou");
        require(!ended,"Leilao ja  terminou");
        //Token.transferFrom(sponser,highestBidder, TokenID);
        ended = true;
        emit End(highestBidder, highestBid);
     }
     function getHighest() public view  returns(address bidder, uint bidValue) {
         bidder = highestBidder;
         bidValue = highestBid;
     }
     function getLances() public view returns(lance[] memory ) {
         return _lances;

     }
}
